import React from "react";
import { useState } from "react";

const Item = () => {
    return(
        <div className="post">

        <div className="post__content">
          <strong>Java Script</strong>
          <div>JS is a cool language</div>
        </div>

        <div className="post__btn">
          <button>Delete Item</button>
        </div>
      </div>
    )
}

export default Item;
